import bootstrap from "bootstrap";
import 'react-bootstrap';
import { Form } from "react-bootstrap";
import { FormText } from "react-bootstrap";

function form() {
    return(
    <>
    <Form.Label htmlFor="inputuser">
        Username
    </Form.Label>
    <Form.Control
        type="text"
        id="inputuser"
    />    
    </>
    );
}
export default Form;
